import React from "react";
import styled from "styled-components";

const row = styled.li`
  width: 90%;
  list-style: none;
  border-bottom: 1px solid #ccc;
  padding: 0.5rem;
  color: #ccc;
`;

const Row = props => {
  return <row />;
};

export default Row;
